import classes from './Button.module.css';

export default function Button({
  type,
  text,
  onClick,
  fontSize,
  width,
  height,
}) {
  return (
    <div className={classes.container}>
      <button
        style={{
          fontSize,
          width,
          height,
        }}
        type={type}
        onClick={onClick}
      >
        {text}
      </button>
    </div>
  );
}

Button.defaultProps = {
  type: 'button',
  text: 'Submit',
  fontSize: '1rem',
  width: '6rem',
  height: '2rem',
};
